#sundayfunday Closing out winter break with a fun trip -Vegas with the kids !!!! Yes, you can do Vegas with kids 🙌… 
Places we took the kids - 
@discoverylv hands on kid heaven ! 
@disneyimmersion an amazing experience at shops at the crystal 
@mandalaybay can never do wrong with an aquarium. 
Fun places to walk around; Cesar’s Palace, Bellagio, fashion show mall & feel like your in Italy at the Venetian.
-
We did 3 nights & did a date night exchange. 1 couple gets a night and last night family night !  Feeling grateful & lucky 🍀 🙏😘!
